from string import ascii_lowercase, ascii_uppercase

data = """"""

tests = ["""dabAcCaCBAcCcaDA"""]

diff = abs(ord('a') - ord('A'))

def react(data):
    nextptr = 0
    result = []
    while nextptr < len(data):
        if len(result) == 0:
            result.append(data[nextptr])
            nextptr += 1
        if abs(result[-1] - data[nextptr]) == diff:
            result.pop()
        else:
            result.append(data[nextptr])
        nextptr += 1
    return len(result)

def run(data):
    minlen = None
    data = [ord(i) for i in data]
    ords_l = [ord(i) for i in ascii_lowercase]
    ords_u = [ord(i) for i in ascii_uppercase]
    for removed in zip(ords_l,ords_u):
        test = [i for i in data if i not in removed]
        l = react(test)
        if minlen is None or l < minlen:
            minlen = l
    return minlen

for test in [t for t in tests if t]:
    try: print(run(test))
    except Exception as e: print("Error:",e)
    
print(run(data))
